    function reverse(a, b) {
        if (a > b) return -1;
        if (a < b) return 1; return 0;
    }
    function setOptions(id) {
        var selbox = document.getElementById(id);
        selbox.options.length = 0;
        var ct = [];
        for (var i = dist.length - 1; i >= 0; i--) {
            ct[i] = dist[i][0] + ',' + i;
        }
        ct.sort(reverse);
        for (var i = dist.length - 1; i >= 0; i--) {
            var c = ct[i].split(',');
            selbox.options[selbox.options.length] = new Option(c[0], c[1]);
        }
        selbox.selectedIndex = 0;
    }
    function calc(eventInfo) {
        var v1 = Number(document.getElementById('ca').value);
        var v2 = Number(document.getElementById('cb').value);
        var dst = 0;
        if (v1 != v2) {
            dst = dist[Math.max(v1, v2)][1][Math.min(v1, v2)];
            //tme = dist[Math.max(v1, v2)][2][Math.min(v1, v2)];
        }
        // change the following line to allow both miles and km if required
        document.getElementById('m').innerHTML = dst + " Rupees";
        //document.getElementById('t').value = tme;
    }
    function start() {
        setOptions('ca');
        setOptions('cb');
    }

    function onSettingsCommand(){
        window.open("http://blog.ankurpshah.in/2013/03/privacy-policy.html");
    }

    function onCommandsRequested(eventArgs){
        var settingsCommand = new Windows.UI.ApplicationSettings.SettingsCommand("privacyPref", "Privacy Policy", onSettingsCommand);
        eventArgs.request.applicationCommands.append(settingsCommand);
    }

    app.start();
